function extra_params(requestUrl, listOfParams){
    const queryString = requestUrl.split('?')[1];
    if(!queryString || listOfParams.length === 0){
        return true;
    }
    const queryParams = queryString.split('&');
    const paramOccurrences = {};
    for(const param of queryParams){
        const [key, value] = param.split('=');
        if(!listOfParams.includes(key)){
            console.error("Extra params is not wanted in request");
            return false;
        }
        if(paramOccurrences[key]){
            console.warn("Overwrite params are not possible here");
            return false;
        }
        paramOccurrences[key] = (paramOccurrences[key] || 0) + 1;
    }
    return true;
}
